const _hoisted_1 = /* @__PURE__ */ createStaticVNode("<ul><li>Bundling is the process of resolving the web of dependencies and merging (or \u2018packaging\u2019) the files (or modules) into optimized bundles for the browser, with the goal of reducing the number of requests for files when a user visits a web page.</li></ul><blockquote><p>\u7ED1\u5B9A \u662F\u89E3\u51B3\u4F9D\u8D56\u5173\u7CFB\u7F51\u7EDC\u5E76\u5C06\u6587\u4EF6\uFF08\u6216\u6A21\u5757\uFF09\u5408\u5E76\uFF08\u6216\u201C\u6253\u5305\u201D\uFF09\u4E3A\u6D4F\u89C8\u5668\u4F18\u5316\u6346\u7ED1\u5305\u7684\u8FC7\u7A0B\uFF0C\u76EE\u7684\u662F\u51CF\u5C11\u7528\u6237\u8BBF\u95EE\u7F51\u9875\u65F6\u5BF9\u6587\u4EF6\u7684\u8BF7\u6C42\u6570\u91CF\u3002</p></blockquote><blockquote><p>Bunding \u662F\u89E3\u51B3web\u4E2D\u7684\u4F9D\u8D56\u5173\u7CFB\u548C\u5408\u5E76\uFF08\u6253\u5305\uFF09\u6587\u4EF6\uFF08\u6A21\u5757\uFF09\u4E3A\u6D4F\u89C8\u5668\u4F18\u5316\u6346\u7ED1\u7684\u8FC7\u7A0B\uFF0C\u76EE\u7684\u662F\u4E3A\u4E86\u51CF\u5C11\u7528\u6237\u8BBF\u95EE\u9875\u9762\u65F6\u8BF7\u6C42\u7684\u6570\u91CF</p></blockquote><ul><li>A framework can solve these problems. But such a framework must have the right level of abstraction \u2014 otherwise it won\u2019t be very useful. It also needs to have great &quot;Developer Experience&quot;, ensuring you and your team have an amazing experience while writing code.</li></ul><blockquote><p>\u4E00\u4E2A\u6846\u67B6\u80FD\u89E3\u51B3\u4E00\u4E9B\u95EE\u9898\uFF0C\u4F46\u662F\u6846\u67B6\u5FC5\u987B\u6709\u6B63\u786E\u7684 \u62BD\u8C61\u7B49\u7EA7 - \u5426\u5219\u4E0D\u4F1A\u975E\u5E38\u597D\u7528\uFF0C\u5B83\u4E5F\u9700\u8981\u6709\u4E0D\u9519\u7684\u201C\u5F00\u53D1\u4F53\u9A8C\u201D\uFF0C\u4FDD\u8BC1\u6CE5\u6CB3\u4F60\u7684\u56E2\u961F\u6709\u60CA\u4EBA\u7684\u7F16\u7801\u4F53\u9A8C</p></blockquote><ul><li>Furthermore, in a production build of Next.js, whenever Link components appear in the browser\u2019s viewport, Next.js automatically prefetches the code for the linked page in the background. By the time you click the link, the code for the destination page will already be loaded in the background, and the page transition will be near-instant!</li></ul><blockquote><p>\u9664\u6B64\u4E4B\u5916\uFF0CNext.js\u6784\u5EFA\u7684\u751F\u4EA7\u73AF\u5883\u4E2D\uFF0C\u53EA\u8981\u6709 Link \u7EC4\u4EF6\u51FA\u73B0\u5728\u6D4F\u89C8\u5668\u7684\u89C6\u7A97\u4E2D\uFF0CNextjs \u4F1A\u5728\u540E\u53F0 \u81EA\u52A8\u5730\u9884\u5148\u8BF7\u6C42\u94FE\u63A5\u9875\u9762\u7684\u4EE3\u7801\u3002<br> \u5F53\u4F60\u70B9\u51FB\u94FE\u63A5\u7684\u65F6\u5019\uFF0C\u76EE\u6807\u9875\u9762\u7684\u4EE3\u7801 \u5728\u540E\u53F0\u5C06\u5DF2\u7ECF\u88AB\u52A0\u8F7D\u5B8C\u6BD5\uFF0C\u9875\u9762\u7684\u8F6C\u6362\u51E0\u4E4E\u5C31\u662F\u5373\u65F6\u7684\uFF01<br></p></blockquote><ul><li>This lesson will also talk about how Next.js handles static assets like images and page metadata like the <code>&lt;title&gt;</code> tag.</li></ul><blockquote><p>\u8FD9\u8282\u8BFE\u4F1A\u544A\u8BC9\u4F60 \u5173\u4E8E\u600E\u6837\u5904\u7406\u56FE\u7247\u9759\u6001\u8D44\u6E90\u548C\u60F3title\u6807\u7B7E\u5143\u6570\u636E</p></blockquote><ul><li>Next.js also has support for Image Optimization by default. This allows for resizing, optimizing, and serving images in modern formats like WebP when the browser supports it. This <em>avoids</em> <em>shipping</em> large images to devices with a smaller viewport. It also allows Next.js to automatically adopt future image formats and serve them to browsers that support those formats.</li></ul><blockquote><p>ship v. \u8FD0\u9001<br> avoid v. \u907F\u514D<br> Nextjs \u9ED8\u8BA4\u4E5F\u652F\u6301\u652F\u6301\u56FE\u7247\u4F18\u5316\uFF0C\u5141\u8BB8\u8C03\u6574\u5927\u5C0F\u3001\u4F18\u5316\u548C\u670D\u52A1\u578B\u56FE\u7247\u50CF WebP \u7684\u73B0\u4EE3\u683C\u5F0F\uFF08\u6D4F\u89C8\u5668\u652F\u6301\u7684\u8BDD\uFF09\uFF0C\u907F\u514D\u4F20\u8F93\u5927\u56FE\u7ED9\u5C0F\u5C4F\u5E55\u3002\u5B83\u4E5F\u5141\u8BB8Next \u81EA\u52A8\u91C7\u7528\u672A\u6765\u56FE\u7247\u683C\u5F0F\u548C\u63D0\u4F9B\u7ED9 \u652F\u6301\u8FD9\u4E9B\u683C\u5F0F\u7684\u6D4F\u89C8\u5668\u3002</p></blockquote><ul><li>This script contains the Facebook SDK which is commonly used to introduce Facebook social plugins and other functionality. Although this approach works, including scripts in this manner does not give a clear idea of when it would load with respect to the other JavaScript code fetched on the same page. If a particular script is render-blocking and can delay page content from loading, this can significantly impact performance.</li></ul><blockquote><p>commonly adv. \u901A\u5E38\u5730<br> approach n. \u65B9\u5F0F\uFF0C\u65B9\u6CD5<br> particular adj. \u8BE6\u7EC6\u7684 \u7279\u6B8A\u7684<br> significantly \u5F15\u4EBA\u6CE8\u76EE\u7684<br> impact n. \u6548\u679C<br> performance \u6027\u80FD<br> \u8FD9\u4E2A\u811A\u672C\u5305\u542B\u4E86Facebook SDK \u901A\u5E38\u7528\u6765\u5F15\u5165 Facebook\u793E\u4EA4\u63D2\u4EF6\u548C\u5176\u4ED6\u529F\u80FD\u3002<br> \u5C3D\u7BA1\u8FD9\u6837\u7684\u65B9\u6CD5\u662F\u8D77\u4F5C\u7528\u7684\uFF0C \u5F53\u540C\u4E00\u4E2A\u9875\u9762\u4F7F\u7528\u5F15\u5165\u811A\u672C\u8FD9\u4E2A\u65B9\u6CD5\u6765\u5F15\u5165\u5176\u4ED6\u811A\u672C\u4EE3\u7801\u4F1A\u4E0D\u6E05\u695A\u5F15\u5165\u7EC6\u8282\u3002\u5982\u679C\u4E00\u4E2A\u7279\u6B8A\u7684\u811A\u672C\u662F\u6E32\u67D3\u963B\u585E\u7684\u5E76\u80FD\u591F\u5728\u5EF6\u65F6\u9875\u9762\u5185\u5BB9\u52A0\u8F7D \uFF0C\u8FD9\u4F1A\u660E\u663E\u63D0\u5347\u6027\u80FD</p></blockquote>", 13);
